import GlobalNav from "./GlobalNav.jsx";
import './Header.css';


function Header({onNav})
{
    return(
        <header>
            <img alt="Website logo - Cat" className="headerimage" src="https://placekitten.com/100/100"/>
            <h1>Cat House</h1>

            <GlobalNav  className="header-nav" onNav={onNav}/>
        </header>

    );
}

export default Header;
